    const {items, filterText, handleFilterText} = props

    const onChange = React.useCallback((e: React.ChangeEvent<{}>, item: IAutocompleteItem) =>{
        console.log(item.label)
    },[handleFilterText])

    return(
        <Autocomplete
            options={items}
            noOptionsText="???"
            getOptionLabel={(x) => x.label}
            onChange={onChange}
            renderInput={(params) => <TextField value={filterText} />}
            />
    )
}

export default AutocompleteInput
